import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import "./style.css";
class Icon extends Component {
    render() {
        return (
            <>
            <FontAwesomeIcon className="icon" icon= {this.props.item.icon}/>
            </>
                
        );
    }
}

export default Icon;
